import{o as n,c as s,d as a}from"./app.0bfd9210.js";const e='{"title":"印象云笔记转md","description":"","frontmatter":{},"headers":[{"level":2,"title":"印象云笔记转md","slug":"印象云笔记转md"},{"level":2,"title":"网易云音乐","slug":"网易云音乐"},{"level":2,"title":"坚果云同步","slug":"坚果云同步"}],"relativePath":"src/private/其他笔记.md","lastUpdated":1626071423000}',t={},o=a('<h2 id="印象云笔记转md"><a class="header-anchor" href="#印象云笔记转md" aria-hidden="true">#</a> 印象云笔记转md</h2><p>安装：<code>npm install enex-dump -g</code></p><p>转换：<code>enex-dump --src ./my-notes.enex</code></p><h2 id="网易云音乐"><a class="header-anchor" href="#网易云音乐" aria-hidden="true">#</a> 网易云音乐</h2><p>1、下载项目：<a href="https://github.com/nondanee/UnblockNeteaseMusic" target="_blank" rel="noopener noreferrer">https://github.com/nondanee/UnblockNeteaseMusic</a> 2、打开cmd，输入：ping <a href="http://music.163.com" target="_blank" rel="noopener noreferrer">music.163.com</a>，并记住ip地址； 3、解压项目，在项目根目录打开cmd，输入<code>node app.js -p 2333 -f 59.111.181.60</code>(这里的ip地址改成你本地ping到的地址) 4、打开网易云音乐设置，找到工具--&gt;自定义代理--&gt;服务器输入：127.0.0.1，端口输入2333(或者node命令指定的端口)</p><h2 id="坚果云同步"><a class="header-anchor" href="#坚果云同步" aria-hidden="true">#</a> 坚果云同步</h2><ol><li><p>路径：</p><div class="language-js"><pre><code><span class="token constant">C</span><span class="token operator">:</span>\\Users\\hny\\AppData\\Roaming\\Nutstore\n</code></pre></div></li><li><p>创建<code>customExtRules.conf</code>文件，放进上面的路径里面，<strong>可以为其他的路径</strong>，重点带db开头就行，里面如果包含以下三个文件之一就行：</p><ul><li>event.db</li><li>ga.data</li><li>nustore.db</li></ul><div class="language-bash"><pre><code><span class="token comment"># 坚果云自定义忽略同步规则</span>\n<span class="token comment"># </span>\n<span class="token comment"># 警告:</span>\n<span class="token comment"># 该文件用来自定义坚果云的忽略同步规则, 文件编码必须为 UTF-8.</span>\n<span class="token comment"># 由于用户修改了自定义忽略规则导致坚果云无法正常工作的问题由用户自己负责.</span>\n<span class="token comment">#</span>\n<span class="token comment"># 说明:</span>\n<span class="token comment"># 每行一条规则. 以 # 开头的行将被忽略.</span>\n<span class="token comment"># 每条规则必须以英文半角句号开头, 否则会忽略</span>\n<span class="token comment"># 无效的规则会被忽略, 并在坚果云日志文件中提示.</span>\n<span class="token comment">#</span>\n<span class="token comment"># 注意事项:</span>\n<span class="token comment"># 忽略规则仅影响文件, 不影响文件夹</span>\n<span class="token comment"># 忽略规则会且仅会在 *上传* 时生效</span>\n<span class="token comment"># 每次修改需要重启客户端才能生效.</span>\n<span class="token comment"># 该规则文件不会自动同步到其他设备.</span>\n<span class="token comment">#</span>\n<span class="token comment"># 例子:</span>\n<span class="token comment"># 忽略所有扩展名为 *.bak 的文件, 规则为 .bak</span>\n\n<span class="token comment"># disabled/blacklist/whitelist 三选一</span>\n<span class="token comment"># disabled 禁用该功能</span>\n<span class="token comment"># blacklist 黑名单模式, 列出的文件类型都不会被上传</span>\n<span class="token comment"># whitelist 白名单模式, 只上传列出的文件类型</span>\n<span class="token assign-left variable">mode</span><span class="token operator">=</span>blacklist\n<span class="token comment"># 规则开始</span>\n.bak\nE:<span class="token punctuation">\\</span>note<span class="token punctuation">\\</span>node_modules <span class="token comment"># 禁止同步具体路径文件夹</span>\nE:<span class="token punctuation">\\</span>note<span class="token punctuation">\\</span>.vuepress<span class="token punctuation">\\</span>dist\n</code></pre></div><p>修改完成需要重启坚果云</p></li></ol>',7);t.render=function(a,e,t,p,c,l){return n(),s("div",null,[o])};export default t;export{e as __pageData};
